import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import ListaSeries from './components/ListaSeries';
import Formulario from './components/Formulario';
import BuscarSerie from './components/BuscarSerie';

const App = () => {
    return (
        <Router>
            <div className="App">
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Lista de Series</Link>
                        </li>
                        <li>
                            <Link to="/nueva-serie">Nueva Serie</Link>
                        </li>
                        <li>
                            <Link to="/buscar-serie">Buscar Serie</Link>
                        </li>
                    </ul>
                </nav>
                <Routes>
                    <Route path="/" element={<ListaSeries />} />
                    <Route path="/nueva-serie" element={<Formulario isUpdating={false} />} />
                    <Route path="/actualizar-serie/:id" element={<Formulario isUpdating={true} />} />
                    <Route path="/buscar-serie" element={<BuscarSerie />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
